//join.kaf305mai.ru/images/research_and_development/robot_carousel/render5.jpg","http://join.kaf305mai.ru/images/research_and_development/robot_carousel/maks_1.jpg"],["http://join.kaf305mai.ru/images/research_and_development/robot_carousel/robot.gif","http://join.kaf305mai.ru/images/research_and_development/robot_carousel/airoport.jpg","http://join.kaf305mai.ru/images/research_and_development/robot_carousel/army.jpg"]],qrCode:{src:"http://qrcoder.ru/code/?https%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3D6jRYPQBJgF4%26t%3D17s&4&0",title:"Обзорное видео комплекса"}}},{title:"Комплексы с подводными аппаратами",fullTitle:"Комплексы с подводными аппаратами",icon:"build",textContent:{text:["Каждый из подводных аппаратов оснащен навигационно-управляющим модулем, разработанным кафедрой 305. В состав модуля могут входить: бесплатформенная инерциальная навигационная система, курсовертикаль, двухантенный приемник ГЛОНАСС/GPS, гидроаккустическая навигационная система, глубиномер, доплеровский ЛАГ, гидролокатор и резервированная распределенная вычислительная система."],list:{title:"Комплексы представляют собой совместную разработку кафедры 305, ОКБ Океанологической техники РАН и других компаний. В состав комплексов в зависимости от назначения могут входить:",items:["• Телеуправляемый необитаемый подводный аппарат","• Автономный необитаемый подводный аппарат","• Автономный носитель гидроакустической аппаратуры переменной плавучести","• Автономный буй переменной плавучести"]},pictures:[["http://join.kaf305mai.ru/images/research_and_development/ANPA/1.jpg","http://join.kaf305mai.ru/images/research_and_development/ANPA/2.jpg","http://join.kaf305mai.ru/images/research_and_development/ANPA/3.jpg"],["http://join.kaf305mai.ru/images/research_and_development/ANPA/4.jpg","http://join.kaf305mai.ru/images/research_and_development/ANPA/anpain.jpg","http://join.kaf305mai.ru/images/research_and_development/ANPA/anpa.gif"]]}},{title:"Автоматизированная система осмотра ВС",icon:"flight",fullTitle:"Автоматизированная система осмотра ВС",textContent:{text:["Автоматизированная система осмотра воздушного судна на стоянке «Спарка» построена на основе интеллектуального автономного\n        колесного робота и мультикоптера. Система предназначена для пред- и послеполетного осмотра ВС на стоянке аэропорта на предмет выявления\n        возможных повреждений внешней поверхности ВС. Колесный робот осуществляет автоматический объезд и осмотр нижней части ВС. Мультикоптер\n        осуществляет автоматический облёт и осмотр верхней части ВС. В процессе осмотра осуществляется фото- и видеофиксация состояния ВС. Особенностью\n        комплекса является наличие системы предупреждения столкновения мультикоптера с ВС на основе тросового механизма, связывающего робот с мультикоптером.\n        Внедрение системы в аэропорту позволит значительно повысить выявляемость повреждений и снизить влияние человеческого фактора."],pictures:[["http://join.kaf305mai.ru/images/research_and_development/multicopters/1.jpg","http://join.kaf305mai.ru/images/research_and_development/multicopters/2.jpg","http://join.kaf305mai.ru/images/research_and_development/multicopters/3.gif"]]}},{title:"Нав. системы на элементной базе",fullTitle:"Навигационные системы на российской элементной базе",icon:"explore",textContent:{text:["На кафедре разработана и изготавливается линейка интегрированных навигационных систем различного класса.\n        Системы используются на различных объектах и построены с использованием преимущественно российской элементной базы."],list:{title:"В состав каждой системы входят:",items:["• Инерциальный измерительный модуль (тип зависит от требуемой точности и габаритов: MEMS или волоконно-оптические гироскопы)","• Cпутниковый навигационный приемник (одно- или многоантенный)","• Контрольно-корректирующая станция ГЛОНАСС/GPS с приемно-передающей аппаратурой","• Вычислительный блок на микропроцессорах"]},pictures:[["http://join.kaf305mai.ru/images/research_and_development/ISNS/vog.jpg","http://join.kaf305mai.ru/images/research_and_development/ISNS/tril.jpg","http://join.kaf305mai.ru/images/research_and_development/ISNS/vog.jpg"]]}}],u=d;var g=a(2323);const h=(0,s.HX)("data-v-0a030843");(0,s.dD)("data-v-0a030843");const w={class:"row"},j={class:"col-lg-3 col-12"},v={class:"col-lg-9 col-12"},x={class:"tabs-content__wrapper"},_={class:"row justify-between q-pt-sm"},f={class:"q-my-auto q-pt-md text-h6 text-weight-medium text-primary q-mb-sm"},b={key:0,class:"q-py-sm"},k={key:1,class:"text-subtitle1 text-primary"},q={key:2,class:"q-py-sm text-subtitle2"},y={key:3,class:"text-subtitle1 text-primary "},C={key:4,class:"q-py-sm text-subtitle2"},W={key:5,class:"q-pa-md"},T={class:"row fit justify-start items-center q-gutter-xs q-col-gutter no-wrap"};(0,s.Cn)();const A=h(((e,t,a,n,l,o)=>{const r=(0,s.up)("q-tab"),i=(0,s.up)("q-tabs"),p=(0,s.up)("AppQRCode"),c=(0,s.up)("q-img"),m=(0,s.up)("q-carousel-slide"),d=(0,s.up)("q-carousel"),u=(0,s.up)("q-card"),A=(0,s.up)("q-tab-panel"),Q=(0,s.up)("q-tab-panels");return(0,s.wg)(),(0,s.j4)("div",w,[(0,s.Wm)("div",j,[(0,s.Wm)(i,{modelValue:n.tab,"onUpdate:modelValue":t[1]||(t[1]=e=>n.tab=e),class:"q-pt-md text-primary",vertical:""},{default:h((()=>[((0,s.wg)(!0),(0,s.j4)(s.HY,null,(0,s.Ko)(a.tabs,((e,t)=>((0,s.wg)(),(0,s.j4)(r,{key:t,icon:e.icon,label:e.title,name:e.icon},null,8,["icon","label","name"])))),128))])),_:1},8,["modelValue"])]),(0,s.Wm)("div",v,[(0,s.Wm)(Q,{modelValue:n.tab,"onUpdate:modelValue":t[3]||(t[3]=e=>n.tab=e),animated:"","transition-next":"jump-up","transition-prev":"jump-up",vertical:""},{default:h((()=>[((0,s.wg)(!0),(0,s.j4)(s.HY,null,(0,s.Ko)(a.tabs,((e,a)=>((0,s.wg)(),(0,s.j4)(A,{key:a,name:e.icon,class:"tabs-content  clear-padding-sm"},{default:h((()=>[(0,s.Wm)(u,{class:"q-px-xl  clear-padding-sm shadow-0 text-primary",style:{background:"#EDF4FA"}},{default:h((()=>[(0,s.Wm)("div",x,[(0,s.Wm)("div",_,[(0,s.Wm)("div",f,(0,g.zw)(""===e.fullTitle?e.title:e.fullTitle),1),e.textContent.qrCode?((0,s.wg)